import React from 'react';
import MaterialTable from 'material-table'
import { Grid, IconButton, makeStyles } from '@material-ui/core';
import AdminLinks from '../management/AdminLinks';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TablePagination from '@material-ui/core/TablePagination';
import TableRow from '@material-ui/core/TableRow';
import Switch from '@material-ui/core/Switch';
import { VisibilityOutlined } from '@material-ui/icons';
const useStyles=makeStyles(()=>({
  list:{
    margin:"80px"
  }
}))
const columns = [
  { id: 'id', label: 'Id', minWidth: 100, align: 'center' },
  { id: 'title', label: 'Title', minWidth: 100, align: 'center' },
  {
    id: 'slug',
    label: 'Slug',
    minWidth: 100,
    align: 'center'

  },
  { id: 'language', label: 'Language', minWidth: 100, align: 'center' }

];

export default function Quizlist() {
  const classes= useStyles()

  const [page, setPage] = React.useState(0);
  const [rowsPerPage, setRowsPerPage] = React.useState(10);
  const handleChangePage = (event, newPage) => {
    setPage(newPage);
  };

  const handleChangeRowsPerPage = (event) => {
    setRowsPerPage(+event.target.value);
    setPage(0);
  };
  return (
    <>
    <AdminLinks/>
     <Grid container justify="center" className={classes.list}>
       <Grid item xs={11} sm={6} md={6} lg={10}>

       <TableContainer className={classes.container}>
        <Table stickyHeader>
          <TableHead>
            <TableRow>
              {columns.map((column) => (
                <TableCell className={classes.table}
                  key={column.id}
                  align={column.align}
                  style={{ minWidth: column.minWidth }}
                >
                  {column.label}
                </TableCell>
              ))} 
              <TableCell className={classes.table}>Active</TableCell>
              <TableCell className={classes.table}>View</TableCell>
              <TableCell className={classes.table}>Result</TableCell>
              <TableCell className={classes.table}>Edit</TableCell>
              <TableCell className={classes.table}>Delete</TableCell>
              <TableCell className={classes.table}>Url</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {/* {list.slice(page * rowsPerPage, page * rowsPerPage + rowsPerPage).map((row) => { */}
              {/* return ( */}
                <TableRow 
                hover 
                role="checkbox"
                 tabIndex={-1}
                //  key={list.userId}
                 >
                  {/* {columns.map((column) => {
                    const value = row[column.id]; */}
                    {/* return ( */}
                      <>
                        <TableCell 
                        // key={value}
                        // align={column.align}
                         >
                          {/* {column.format && typeof value === 'number' ? column.format(value) : value} */}
                        </TableCell>
                      </>
                  {/* //   );

                  // })} */}
                  <TableCell>
                    {/* {
                      row.status === "active" ? */}
                        <Switch
                          // checked={true}
                          // onChange={checkedStatus(row.userId)}
                          name="checkedA"
                          color="primary"
                          // id={row.userId}
                          inputProps={{ 'aria-label': 'primary checkbox' }}
                        /> 
                        {/* :
                        <Switch
                          checked={false}
                          onChange={checkedStatus(row.userId)}
                          name="checkedA"
                          color="primary"
                          id={row.userId}
                          inputProps={{ 'aria-label': 'primary checkbox' }}
                        />
                    } */}
                  </TableCell>
                  <TableCell>
                    <IconButton>
                      <VisibilityOutlined/>
                    </IconButton>
                  </TableCell>
                  <TableCell>
                    <IconButton>
                      <FontAwesomeIcon icon={faTrofy}/>
                    </IconButton>
                  </TableCell>
                </TableRow>
            {/* //   );
            // })} */}
          </TableBody>
        </Table>
      </TableContainer>
      <TablePagination
        rowsPerPageOptions={[10, 25, 100]}
        component="div"
        // count={list.length}
        rowsPerPage={rowsPerPage}
        page={page}
        onChangePage={handleChangePage}
        onChangeRowsPerPage={handleChangeRowsPerPage}
      /> 
       </Grid>
    </Grid>
    </>

  )
}
